import React from "react";
import classes from './NavBar.module.css';
import {NavLink} from 'react-router-dom'

console.log(classes)
// let classes = {
//     'nav': 'NavBar_nav__IQUWY',
//     'item': 'NavBar_item__9kGvf'
// }

// let c1 = 'item';
// let c2 = 'active';
//
// let classes = c1 + ' ' + c2
// let classecActive = `${classes.item} ${c2}`;






export const NavBar = () => {

    const MyLink = () => (
        <NavLink
            to={'/routes'}
            className={({ activeLink }) =>
                activeLink ? classes.activeLink : undefined
            }
        >
            My route
        </NavLink>
    );

   return  <nav className={classes.nav}>
       <div className={`${classes.item}`}>
           <NavLink to={'PROFILE'} activeClassName={classes.activeLink}>Profile</NavLink>
       </div>
       <div className={classes.item}>
           <NavLink to={'DIALOGS'} className={classes.active}>Messages</NavLink>
       </div>
       <div className={classes.item}>
           <NavLink to={'NEWS'} className={classes.active}>News</NavLink>
       </div>
       <div className={classes.item}>
           <NavLink to={'MUSIC'} className={classes.active}>Music</NavLink>
       </div>
       <div className={classes.item}>
           <NavLink to={'SETTINGS'} className={classes.active}>Settings</NavLink>
       </div>
   </nav>
}
